import React from 'react'
import { Button, Card } from 'react-bootstrap';
import { Juegos } from './Juegos';
import './PortfolioVG.css'
import { DiApple, DiGithubBadge } from "react-icons/di";


export default function PortfolioVG() {
  return (
    <div className='gim'>
    <div className='grid1'>
    { Juegos.map((lider, index) => {
      return(
    <Card className='cardB' style={{ width: '18rem' }}>
    <Card.Img variant="top" src={lider.image} />
    <Card.Body>
      <Card.Title>{lider.name}</Card.Title>
      <Card.Text>
        {lider.description}
      </Card.Text>
      <Button href="#">
      <DiGithubBadge width={"100"}/>
      </Button>
      <Button variant="primary">Go somewhere</Button>
    </Card.Body>
  </Card>
      );
    })}
   </div>
   </div>
  )
}
